import React, { Component } from "react";
import "./App.css";

class Question extends Component {
  render() {
    return (
        <div>
          <button type="button" class="btn btn-danger mt-2">Q{this.props.data_index}: {this.props.question}</button>

        </div>
    );
  }
}

export default Question;
